import React, { useState } from "react";
import "./App.css";
import Filters from "./Filters";
import Plots from "./Plots";

function App() {
  const [filters, setFilters] = useState({
    selectedSites: [],
    selectedParameters: [],
    startDate: new Date(),
    endDate: new Date(),
  });

  return (
    <div className="dashboard">
      <header className="header">NW Michigan Water Coalition</header>
      <div className="container">
        <Filters onFilterChange={setFilters} />
        <main className="plots">
          <Plots selectedParameters={filters.selectedParameters} />
        </main>
        <section className="map">Map</section>
      </div>
    </div>
  );
}

export default App;
